import React from "react";
import "../App.css";

const Home = () => {
  return (
    <div className="App">
      <header className="App-header">
        <img src={process.env.PUBLIC_URL + "/resources/pik.png"} width="400" />
        <h1>Poke App</h1>
      </header>
    </div>
  );
};

export default Home;
